  const [status, setStatus] = useState(false)

  const getStatus = () => {
    setStatus(!status)
    console.log(status)
  }
  return (
    <article>
      <p>Id: {id}</p>
      <p>Todo: {text}</p>
      {/* <p>Status: {status}</p> */}
      <button type="button" onClick={getStatus}>
        Complete
      </button>
      <button type="button">Delete</button>
    </article>
  )
}
